@PatrickVenholdt Okei, beklager at jeg har brukt utydelig retorikk.❤️
Jeg skjønner alvoret, og oppfordrer alle mine venner til å være så forsiktige som mulig, og ta ansvar.

Det betyr ikke at regjeringen skal gi folk bot hvis de går uten munnbind, slik de gjør i Bergen nå.

@jabbidabbadoo Forskningsmetoder har ingenting med ideologi å gjere. God forskning følger logikk og strengt objektive kriterier. 
Tolking av resultat derimot kan gjerast politisk. 
Har du aldri jobba med forskarar som har gitt innblikk i prosessane? Eg e forundra over di manglande forståelse🤷🏼‍♂️
